import { useState } from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import TabPanel from './TabPanel';
import PriceTable from './NFTs/PriceTable';
import Sales from './Sales/Sales';
import Metamon from './Metamon/Metamon'
import Elemon from './Elemon/Elemon'
import { Link } from 'react-router-dom'
import '../App.css'

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

const HeaderTabs = () => {
    const [value, setValue] = useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    const routeMatch = useRouteMatch(['/nfts', '/drafts', '/metamon', '/elemon']);
    const currentTab = routeMatch?.pattern?.path;

    return (

        <Box sx={{ width: '100%' }}>
            <Box id="tabs" sx={{ borderBottom: 1, borderColor: 'divider' }}>
                <Tabs sx={{ color: '#ffffff' }} value={currentTab} onChange={handleChange} aria-label="basic tabs example">
                    <Tab to='/nfts' value='/nfts' label="NFTs" {...a11yProps(0)} component={Link}/>
                    <Tab to='/sales' value='/sales' label="Sales" {...a11yProps(1)} component={Link}/>
                    <Tab to='/metamon' value='/metamon' label="Metamon" {...a11yProps(2)} component={Link}/>
                    <Tab to='/elemon' value='/elemon' label="Elemon" {...a11yProps(3)} component={Link}/>
                </Tabs>
            </Box>
            <TabPanel value={currentTab} index={`/nfts`}>
                <PriceTable />
            </TabPanel>
            <TabPanel value={currentTab} index={`/sales`}>
                <Sales />
            </TabPanel>
            <TabPanel value={currentTab} index={`/metamon`}>
                <Metamon />
            </TabPanel>
            <TabPanel value={currentTab} index={`/elemon`}>
                <Elemon />
            </TabPanel>
        </Box>
    );
}

export default HeaderTabs;
